import React from "react";
import "./App.css";

const Search = () => {
  return (
    <div className="search">
      <div className="partner">
        <p className="partnerpara">
          Find <span className="span">partner</span>(CAs) Avilable Online
        </p>
      </div>
      
    </div>
  );
};

export default Search;
